import pytest
import string


def isSubsequence(s: str, t: str) -> bool:
    lastIndex = 0
    for c in s:
        lastIndex = t.find(c, lastIndex)
        if lastIndex < 0:
            return False
        lastIndex += 1

    return True


@pytest.mark.parametrize(
    "s,t,expected",
    [
        ("abc", "ahbgdc", True),
        ("axc", "ahbgdc", False),
        (
            "leeeeetcode",
            "",
            True,
        ),
        ("aaaaaa", "bbaaaa", False),
    ],
)
def test_isSubsequence(s: str, t: str, expected: bool):
    assert isSubsequence(s, t) is expected
